    data: |
      SELECT DISTINCT + cor1.col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q11528.out
    data: |
      7
      78
      79
